import React from 'react';
import Slider from 'react-slick';
import { Box, Typography, useTheme, useMediaQuery } from '@mui/material';
import MovieCard from './MovieCard';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const MovieSlider = ({ title, movies, slidesToShow = 6 }) => {
  const theme = useTheme();
  const isXs = useMediaQuery(theme.breakpoints.down('sm'));
  const isSm = useMediaQuery(theme.breakpoints.between('sm', 'md'));
  const isMd = useMediaQuery(theme.breakpoints.between('md', 'lg'));
  const isLg = useMediaQuery(theme.breakpoints.between('lg', 'xl'));

  // Responsive settings
  const getResponsiveSlidesToShow = () => {
    if (isXs) return Math.min(2, movies.length);
    if (isSm) return Math.min(3, movies.length);
    if (isMd) return Math.min(4, movies.length);
    if (isLg) return Math.min(5, movies.length);
    return Math.min(slidesToShow, movies.length);
  };

  const settings = {
    dots: false,
    infinite: movies.length > getResponsiveSlidesToShow(),
    speed: 500,
    slidesToShow: getResponsiveSlidesToShow(),
    slidesToScroll: 1,
    autoplay: movies.length > getResponsiveSlidesToShow(),
    autoplaySpeed: 4000,
    pauseOnHover: true,
    swipeToSlide: true,
    arrows: !isXs && movies.length > getResponsiveSlidesToShow(),
    touchMove: true,
    draggable: true,
    responsive: [
      {
        breakpoint: 1536, // xl
        settings: {
          slidesToShow: Math.min(6, movies.length),
          slidesToScroll: 1,
          arrows: movies.length > 6,
        },
      },
      {
        breakpoint: 1200, // lg
        settings: {
          slidesToShow: Math.min(5, movies.length),
          slidesToScroll: 1,
          arrows: movies.length > 5,
        },
      },
      {
        breakpoint: 900, // md
        settings: {
          slidesToShow: Math.min(4, movies.length),
          slidesToScroll: 1,
          arrows: movies.length > 4,
        },
      },
      {
        breakpoint: 600, // sm
        settings: {
          slidesToShow: Math.min(3, movies.length),
          slidesToScroll: 1,
          arrows: false,
        },
      },
      {
        breakpoint: 480, // xs
        settings: {
          slidesToShow: Math.min(2, movies.length),
          slidesToScroll: 1,
          arrows: false,
          centerMode: movies.length === 1,
          centerPadding: movies.length === 1 ? '20%' : '0',
        },
      },
    ],
  };

  if (!movies || movies.length === 0) {
    return null;
  }

  return (
    <Box sx={{ 
      mb: { xs: 3, sm: 4 },
      '& .slick-track': {
        display: 'flex',
        alignItems: 'stretch',
      },
      '& .slick-slide': {
        px: { xs: 0.5, sm: 1 },
        '& > div': {
          height: '100%',
        },
      },
      '& .slick-prev, & .slick-next': {
        zIndex: 1,
        width: { xs: 30, sm: 40 },
        height: { xs: 30, sm: 40 },
        '&::before': {
          fontSize: { xs: 16, sm: 20 },
        },
      },
    }}>
      <Typography
        variant="h5"
        component="h2"
        sx={{
          mb: { xs: 1.5, sm: 2 },
          fontSize: { xs: '1.25rem', sm: '1.5rem' },
          fontWeight: 'bold',
          display: 'flex',
          alignItems: 'center',
          '&::before': {
            content: '""',
            width: 4,
            height: 24,
            backgroundColor: 'primary.main',
            display: 'inline-block',
            marginRight: 1,
            borderRadius: 1,
          },
        }}
      >
        {title}
      </Typography>

      <Box
        sx={{
          '.slick-prev, .slick-next': {
            zIndex: 1,
            width: 40,
            height: 40,
            backgroundColor: 'rgba(0, 0, 0, 0.5)',
            borderRadius: '50%',
            transition: 'all 0.3s ease',
            '&:hover': {
              backgroundColor: 'primary.main',
            },
            '&::before': {
              fontSize: 20,
            },
          },
          '.slick-prev': {
            left: -5,
          },
          '.slick-next': {
            right: -5,
          },
          '.slick-track': {
            display: 'flex',
            gap: 2,
            margin: '0 -8px',
          },
          '.slick-slide': {
            padding: '0 8px',
            height: 'auto',
            '& > div': {
              height: '100%',
            },
          },
        }}
      >
        <Slider {...settings}>
          {movies.map((movie) => (
            <Box key={movie._id} sx={{ height: '100%', pb: 1 }}>
              <MovieCard movie={movie} />
            </Box>
          ))}
        </Slider>
      </Box>
    </Box>
  );
};

export default MovieSlider;
